import React from "react";
import "../62P.css";
import Question1 from "../img/Question1.jpg";
import Question2 from "../img/Question2.jpg";
import Question3 from "../img/Question3.jpg";
import Question4 from "../img/Question4.jpg";
import Question5 from "../img/Question5.jpg";

const questions = [
    
  { id: 1, image: Question1 },
  { id: 2, image: Question2 },
  { id: 3, image: Question3 },
  { id: 4, image: Question4 },
  { id: 5, image: Question5 },
];

const P62Question = ({ onLeftSelect }) => {
  return (
    <div className="left-column">
      {questions.map((q) => (
        <div
          className="question-item"
          key={q.id}
          id={`left-${q.id}`}
          onClick={() => onLeftSelect(q.id)}
        >
          /<img src={q.image} alt={`Question ${q.id}`} className="question-image" /><img
  src={q.image}
  alt={`Question ${q.id}`}
  style={{
    maxWidth: "300px",
    maxHeight: "200px",
    width: "auto",
    height: "auto",
    border: "1px solid #ddd",
    borderRadius: "5px",
  }}
/>

        </div>
      ))}
    </div>
  );
};

export default P62Question;
